import React from 'react';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <footer>
      <button onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}>Top of Page</button>
      <div>
        <Link to="/search">Tote Bag</Link>
        <Link to="/search">Shoulder Bag</Link>
        <Link to="/search">Backpack</Link>
        <Link to="/search">Handbag</Link>
        <Link to="/search">Wallet</Link>
      </div>
      <div>
        <Link to="/accountmanage">Manage Accounts</Link>
        <Link to="/productmanage">Manage Bags</Link>
      </div>
      <div>
        <Link to="/ourteam">Our Team</Link>
      </div>
    </footer>
  );
}

export default Footer;
